import craft from "./images/craft.jpg"

const favoriteData = [
    {
        image: {craft},
        title: "first title",
        description: "first description",
        id: 1
    },
    {
        image: {craft},
        title: "second title",
        description: "second description",
        id: 2
    },
    {
        image: {craft},
        title: "third title",
        description: "third description",
        id: 3
    }
]

export { favoriteData }
